import StorePage from "./StorePage";
import ProductDetail from "./ProductDetail";
import { Route } from "react-router-dom/cjs/react-router-dom.min";
import CartProvider from "../Context/CartProvider";
const STORE = () => {
  return (
    <CartProvider>
      <StorePage />
      <Route path='/STORE/:Id'>
        <ProductDetail />
      </Route>
    </CartProvider>
  );
};
export default STORE;
